import { reverse } from './reverse';
import { pipe } from './pipe';
describe('data first', function () {
    test('reverse', function () {
        var actual = reverse([1, 2, 3]);
        expect(actual).toEqual([3, 2, 1]);
    });
    describe('reverse typings', function () {
        test('arrays', function () {
            var actual = reverse([1, 2, 3]);
            var result = true;
            expect(result).toEqual(true);
        });
        test('tuples', function () {
            var actual = reverse([1, 2, [true], 'a']);
            var result = true;
            expect(result).toEqual(true);
        });
        test('variadic tuples', function () {
            var input = [1, 'two', 'three'];
            var actual = reverse(input);
            var result = true;
            expect(result).toEqual(true);
        });
    });
});
describe('data last', function () {
    test('reverse', function () {
        var actual = pipe([1, 2, 3], reverse());
        expect(actual).toEqual([3, 2, 1]);
    });
    describe('reverse typings', function () {
        test('arrays', function () {
            var actual = pipe([1, 2, 3], reverse());
            var result = true;
            expect(result).toEqual(true);
        });
        test('tuples', function () {
            var actual = pipe([1, 2, [true], 'a'], reverse());
            var result = true;
            expect(result).toEqual(true);
        });
        test('variadic tuples', function () {
            var input = [1, 'two', 'three'];
            var actual = pipe(input, reverse());
            var result = true;
            expect(result).toEqual(true);
        });
    });
});
